import React from "react";
import foodTypes from "../foodTypeData2"

const MenuFood = () => {
  console.log(foodTypes);
  return (
    <div className="menu-food">
      <p>Select your ingredients/prep method:</p>
      {Object.keys(foodTypes).forEach(type => {
        return (
          <p>{type}</p>
        )
      })}
    </div>
  );
};

export default MenuFood;
